import React from 'react'
import '../styles/Header.css'

const Header = ({placeholder, title}) => {
  return (
    <div className='container'>
      <button>
        Crear {placeholder}
      </button>

      <h1>
        {title}
      </h1>
    </div>
  )
}

export default Header
